import React, { Component } from 'react';


export default class AddFishForm extends Component {
  createFish = e => {
    e.preventDefault();
    console.log("Making a fish")
  }

  render() {
    return (
      <form className="fish-edit" onSubmit={this.createFish}>
        <input name="name" ref={this.Ref} type="text" placeholder="Name" />
        <input name="price" ref={this.Ref} type="text" placeholder="Price" />
        <select name="status" ref={this.Ref}>
          <option value="available">Fresh!</option>
          <option value="unavailable">Sold Out!</option>
        </select>
        <textarea name="desc" ref={this.Ref} placeholder="Desc" />
        <input name="image" ref={this.Ref} type="text" placeholder="Image" />
        <button type="submit">+ Add Fish</button>
      </form>
    )
  }
}
